INSERT INTO `os_content` VALUES(1, 'গাজীরহাট মাধ্যমিক বিদ্যালয়, কালীগঞ্জ, ঝিনাইদহ', 'welcome-message-from-sp', '<h2 style=" background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">গাজীরহাট</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">মাধ্যমিক</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">বিদ্যালয়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34">, </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">কালীগঞ্জ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34">, </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">ঝিনাইদহ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34">&nbsp;</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"></span></h2>\r\n\r\n<p align="center">\r\n</p>\r\n\r\n<p style=" background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">কেন্দ্রবর্তী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">স্থানে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">অবস্থিত।</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">গ্রামীণ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">এলাকায়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">নারীশিক্ষা</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিস্তারের</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">লক্ষে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">স্থানীয়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">শিক্ষানুরাগী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">ব্যক্তিদের</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">সহযোগিতায়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">১৯৯৩ইং</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">সালে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333">&nbsp; </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">বিদ্যালয়টি</span><span style="font-size:\r\n7.5pt;Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">প্রতিষ্ঠা</span