INSERT INTO `os_content` VALUES(17, '      *উল্লেখযোগ্য অর্জনঃ', 'community-policing', '<p>২০১৬ সালের এস এস সি পরীক্ষায় ১ জন এ+</p>\r\n<p>২০১৫ সালের জে এস সি পরীক্ষায় শতভাগ পাশ</p>\r\n<p>২০১৫ সালের পি এস সি পরীক্ষায় শতভাগ পাশ<br>\r\n</p>\r\n', '', 1, 1, '2013-09-26 00:00:00', 1, '2017-08-03 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
