INSERT INTO `os_content` VALUES(29, 'প্রধান শিক্ষক  মহোদয়ের বানী', 'message-from-sp', '<p>\r\n</p>\r\n\r\n<h2 style=" background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">গাজীরহাট</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">মাধ্যমিক</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">বিদ্যালয়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34">, </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">কালীগঞ্জ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34">, </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#943E34">ঝিনাইদহ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#943E34">&nbsp;</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"></span></h2>\r\n\r\n<p>\r\n<span id="pastemarkerend">\r\n</span></p>\r\n\r\n<p style=" background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">কেন্দ্রবর্তী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">স্থানে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">অবস্থিত।</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">গ্রামীণ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">এলাকায়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">নারীশিক্ষা</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিস্তারের</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">লক্ষে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">স্থানীয়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">শিক্ষানুরাগী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">ব্যক্তিদের</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">সহযোগিতায়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">১৯৯৩ইং</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">সালে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333">&nbsp; </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">বিদ্যালয়টি</span><span style="font-size:\r\n7.5pt;Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">প্রতিষ্ঠা</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">করা</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">হয়।</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">&nbsp;</span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিদ্যালয়ের</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">জমি</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">স্থানীয়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">&nbsp;</span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">শিক্ষানুরাগী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333">&nbsp; </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">লোকজন</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিদ্যালয়ের</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">নামে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">দান</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">করেন।</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিদ্যালয়টির</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">এখন</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">মোট</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">১০২</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">শতাংশ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">জমি</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">আছে।</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">প্রথমে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিদ্যালয়টি</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">১জানুয়ারী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">১৯৯৫ইং</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">সালে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">নিম্ন</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">মাধ্যমিক</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">বিদ্যালয়</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">হিসেবে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">একাডেমিক</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">স্বীকৃতি</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">লাভ</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">করে।</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">পরবর্তিতে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">&nbsp;</span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">১জানুয়ারী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="font-size:\r\n7.5pt;Vrinda&quot;,&quot;sans-serif&quot;;color:#333333">২০০২ইং</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> </span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">সালে</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">&nbsp;</span><span style="Vrinda&quot;,&quot;sans-serif&quot;;\r\ncolor:#333333">রাজশাহী</span><span style="Helvetica&quot;,&quot;sans-serif&quot;;color:#333333"> 