INSERT INTO `os_content` VALUES(58, 'ক্লাশ রুটিন ( প্রাক-প্রাথমিক হতে দশম শ্রেণি পর্যন্ত)', 'ক্লাশ-রুটিন-(ইবতেদায়ী,দাখিল,আলিম-ও-ফাযিল-স্তর)', '&nbsp;\r\n<h1>চুয়াডাঙ্গা কৃষ্ণানগর মাধ্যমিক বিদ্যালয়</h1>\r\n\r\n<p>বিদ্যালয়ঃ৬৩৯৪                         <b>ক্লাস রুটিন\r\n-২০১৬</b>                         ই আই এনঃ ১১৫৮৪০</p>\r\n\r\n\r\n<table style="border-collapse:collapse;\r\n border:none;" border="1" cellpadding="0" cellspacing="0" width="1194">\r\n\r\n<tbody>\r\n\r\n	<tr style="height:24.25pt">\r\n\r\n		<td style="width:22.5pt;border:solid windowtext 1.0pt;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="30">\r\n  </td>\r\n\r\n\r\n		<td style="width:103.5pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="138">\r\n  <p>শিক্ষক/শিক্ষকার নাম ও পদবী</p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:31.5pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="42">\r\n  </td>\r\n\r\n\r\n		<td style="width:112.5pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="150">\r\n  <p>   ১ম পিরিয়ড </p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:1.5in;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="144">\r\n  <p>    ২য় পিরিয়ড</p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:121.5pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="162">\r\n  <p>   ৩য় পিরিয়ড</p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:.25in;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="24">\r\n  </td>\r\n\r\n\r\n		<td style="width:112.5pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt;height:24.25pt" valign="top" width="150">\r\n  <p>  &nbsp; ৪র্থ পিরিয়ড</p>\r\n\r\n 