INSERT INTO `os_content` VALUES(74, 'ইতিহাস', 'ইতিহাস', 'ঐতিহ্যবাহী&nbsp;<span id="pastemarkerend"><span id="pastemarkerend"><span id="pastemarkerend"><span style="color: #9bbb59;"><span style="background-color: rgb(255, 255, 255);"> জোড়াবাড়ী বালিকা উচ্চ বিদ্যালয়<span id="pastemarkerend">&nbsp;<span id="pastemarkerend"> </span></span></span></span></span></span></span><p><img src="/images/1501729487_20160101_110613.jpg" alt="" unselectable="on" style="cursor: default;"></p>\r\n\r\n<p><img src="/images/1501729776_20160101_114257.jpg" alt="" unselectable="on" style="cursor: default;"></p>\r\n\r\nনীলফামারী\r\n জেলার ডোমার উপজেলার ৪নং জোড়াবাড়ী ইউনিয়নের কেন্দ্রবর্তী স্থানে অবস্থিত। \r\nগ্রামীণ এলাকায় নারীশিক্ষা বিস্তারের লক্ষে স্থানীয় শিক্ষানুরাগী \r\nব্যক্তিদের সহযোগিতায় ১৯৯৩ইং সালে&nbsp; বিদ্যালয়টি প্রতিষ্ঠা করা হয়। <span id="pastemarkerend">বিদ্যালয়ের জমি স্থানীয় </span><span id="pastemarkerend"> শিক্ষানুরাগী<span id="pastemarkerend"></span>&nbsp;\r\n লোকজন বিদ্যালয়ের নামে দান করেন। বিদ্যালয়টির এখন মোট ১০২ শতাংশ জমি আছে। \r\nপ্রথমে বিদ্যালয়টি ১জানুয়ারী ১৯৯৫ইং সালে নিম্ন মাধ্যমিক বিদ্যালয় হিসেবে \r\nএকাডিমিক স্বীকৃতি লাভ করে। পরবর্তিতে </span><span id="pastemarkerend"><span id="pastemarkerend"> ১জানুয়ারী ২০০২ইং সালে<span id="pastemarkerend"> রাজশাহী শিক্ষা বোর্ডের অধিনে মাধ্যমিক বিদ্যালয় হিসেবে পাঠদানের অনুমতি প্রাপ্ত হয় এবং</span></span></span><span id="pastemarkerend"><span id="pastemarkerend"><span id="pastemarkerend"><span id="pastemarkerend"> ১জানুয়ারী ২০০৫ইং সালে<span id="pastemarkerend">\r\n উক্ত শিক্ষাবোর্ডের অধিনে মাধ্যমিক বিদ্যালয় হিসেবে&nbsp; একাডেমিক স্বীকৃতি \r\nলাভ করে। বর্তমানে বিদ্যালয়টিতে ১১জন শিক্ষক ও ৫জন কর্মচারী কর্মরত আছে এবং\r\n নিয়মিত ম্যানেজিং কমিটি&nbsp; ও স্থানীয় লোকজনের সহযোগিতায় সুষ্ঠ ভাবে পরিচালিত\r\n হয়ে আসছে।</span></span></span></span></span><span id="pastemarkerend"><span id="pastemarkerend"><span id="pastemarkerend"><span id="pastemarkerend"><span id="pastemarkerend"> এলাকার নারী শিক্ষা বিস্তারের লক্ষ্যে বিদ্যালয়টি গুরুত্ব পূর্ণ ভূমিকা পালন করছে।&nbsp;</span></span> </span></span>&nbsp; \r\n<span id="pastemarkerend">&nbsp;</span></span>\r\n<p>\r\n</p>\r\n', '', 1, 1, '2016-05-21 00:00:00', 55, '2017-08-04 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, '1501729819_20160101_114257.jpg');
