INSERT INTO `os_content` VALUES(77, 'প্রতিষ্ঠাতা', 'প্রতিষ্ঠাতা', '<p><br>\r\n<span id="pastemarkerend">&nbsp;মোঃ ইনছানুল হক</span></p>\r\n<p><span id="pastemarkerend">পিতা মৃত আব্দুর রহমান</span></p>\r\n<p><span id="pastemarkerend">গ্রাম: জোড়াবাড়ী, ডাকঘর: মিরজাগঞ্জ, উপজেলা: ডোমার, জেলা: নীলফামারী।<br>\r\n</span></p>\r\n', '', 1, 1, '2016-05-21 00:00:00', 55, '2017-08-01 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, '1501572467_20160101_112119.jpg');
INSERT INTO `os_content` VALUES(78, 'দাতা ও সহযোগী সদস্য', 'দাতা-ও-সহযোগী-সদস্য', '<p>দাতা ও সহযোগী সদস্য<span id="pastemarkerend"> গণপ্রজাতন্ত্রী বাংলাদেশ সরকার এবং স্থানীয় শিক্ষানুরাগী দানশীল ব্যক্তি।</span><br>\r\n\r\n</p>\r\n<br>\r\n', '', 1, 1, '2016-05-21 00:00:00', 55, '2017-08-04 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
INSERT INTO `os_content` VALUES(79, 'দর্শন ও উদ্দেশ্য', 'দর্শন-ও-উদ্দেশ্য', '<p>দর্শন<span id="pastemarkerend"></span> ও উদ্দেশ্য<span id="pastemarkerend"> <br>\r\n\r\n</span></p>\r\n\r\n<p><span id="pastemarkerend"></span>নিম্নলিখিত লক্ষ্য ও উদ্দেশ্যকে সামনে রেখে অত্র বিদ্যালয়ের সকলেই নিরলস ভাবে কাজ করে যাচ্ছে :--<br>\r\n\r\n</p>\r\n\r\n<p style="text-align: justify;">&nbsp;শিক্ষার্থীদের দায়িত্ব, কর্তব্য, শৃঙ্খলা, নৈতিকতা, ও সময়ানুবর্তিতা সম্পর্কে সচেতন করে গড়ে তোলা।</p>\r\n\r\n<p style="text-align: justify;">শিক্ষার্থীদের চিন্তা-চেতনা ও কর্মে সৃজনশীলতা, দেশপ্রেম ও মানবতাবোধ জাগ্রত করা।</p>\r\n\r\n<p style="text-align: justify;">শিক্ষার পাশাপাশি শারীরিক ও মানসিক গুণাবলি বিকাশে সহায়তা করা।</p>\r\n\r\n<p style="text-align: justify;">শিক্ষার্থীদের নেতৃত্ব ও ব্যক্তিত্বের বিকাশ এবং উচ্চ শিক্ষা গ্রহণের উপযোগী করে গড়ে তোলা।</p>\r\n\r\n<p style="text-align: justify;">তত্ত্বীয় জ্ঞানে সীমাবদ্ধ না থেকে যথাযথ উপকরণ ব্যবহারের মাধ্যমে শিক্ষাকে বাস্তবভিত্তিক ও আনন্দময় করা।</p>\r\n\r\n<p style="text-align: justify;">শিক্ষার্থীদের মধ্যে প্রতিযোগিতার মনোভাব সৃষ্টি করা।</p>\r\n\r\n<p style="text-align: justify;">শিক্ষার্থীদের বিজ্ঞান ও প্রযুক্তিমনস্ক করে গড়ে তোলা।<br>\r\n\r\n</p>\r\n\r\n<p style="text-align: justify;"> <span id="pastemarkerend">শিক্ষার্থীদের সুনাগরিক হিসেবে গড়ে তোলা।</span><br>\r\n\r\n<span id="pastemarkerend"></span></p>\r\n', '', 1, 1, '2016-05-21 00:00:00', 55, '2017-09-04 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
INSERT INTO `os_content` VALUES(80, 'মেসেজ ও জীবন বৃতান্ত', 'মেসেজ-ও-জীবন-বৃতান্ত', '<p>মেসেজ ও জীবন বৃতান্ত<span id="pastemarkerend">&nbsp;</span><br>\r\n\r\n</p>\r\n\r\n<p>১। নাম: মোঃ মমিনুর রহমান<br>\r\n\r\n</p>\r\n\r\n<p>২। পিতা নাম: মোঃ জমির উদ্দিন <br>\r\n\r\n</p>\r\n\r\n<p>৩। মাতার নাম: মোছাঃ সামসুন নাহার\r\n</p>\r\n\r\n<p>৪। বর্তমান ঠিকানা: গ্রাম: নিজ ভোগডাবুড়ী&nbsp; ডাক: চিলাহাটি, উপজেলা: ডোমার, জেলা: নীলফামারী<br>\r\n\r\n</p>\r\n\r\n<p>৫। স্থায়ী ঠিকানা:&nbsp; গ্রাম: উপন চৌকী ভাজনী, ডাকঘরঃ ভাউলাগঞ্জ, উপজেলা: দেবীগঞ্জ,\r\nজেলা: পঞ্চগড়।<br>\r\n\r\n</p>\r\n\r\n<p>৬। মোবাইল নং-: ০১৭২০৫৪৬৯২৯</p>\r\n\r\n<p>৭। জন্ম তারিখ: ৩১শে ডিসেম্বর,\r\n১৯৭১ইং। </p>\r\n\r\n<p>৮। বৈবাহিক অবস্থা: বিবাহিত\r\n</p>\r\n\r\n<p>৯। ধর্ম: ইসলাম </p>\r\n\r\n<p>১০।জাতীয়তা: বাংলাদেশী </p>\r\n\r\n<p>১১।শিক্ষাগত যোগ্যতা: </p>\r\n\r\n\r\n<table style="border-collapse:collapse;border:none;" cellspacing="0" cellpadding="0" border="1">\r\n\r\n<tbody>\r\n\r\n	<tr>\r\n\r\n		<td style="width:116.85pt;border:solid windowtext 1.0pt;padding:0in 5.4pt 0in 5.4pt" width="156" valign="top">\r\n  <p style="line-height:\r\n  normal">পাশের নাম</p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:116.85pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt" width="156" valign="top">\r\n  <p style="line-height:\r\n  normal">বোর্ড/ বিশ্ববিদ্যালয়</p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:116.9pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt" width="156" valign="top">\r\n  <p style="line-height:\r\n  normal">ফলাফল</p>\r\n\r\n  </td>\r\n\r\n\r\n		<td style="width:116.9pt;border:solid windowtext 1.0pt;\r\n  border-left:none;padding:0in 5.4pt 0in 5.4pt" width="156" valign="top">\r\n  <p style="line-height:\r\n  normal">পাশের বছর </p>\r\n\r\n  </td>\r\n\r\n 	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="width:116.85pt;border:solid windowtext 1.0pt;\r\n  border-top:none;\r\n  padding:0in 5.4pt 0in 5.4pt" width="156" valign="top">\r\n  <p style="line-height