INSERT INTO `os_content` VALUES(81, 'সাবেক প্রতিষ্ঠান প্রধান', 'সাবেক-প্রতিষ্ঠান-প্রধান', '<p>সাবেক প্রতিষ্ঠান প্রধান<span id="pastemarkerend">&nbsp;</span><br>\r\n\r\n</p>\r\nমোঃ ইসলাম দফাদার<br>\r\nগ্রাম: সারুটিয়া, ডাকঃ সারুটিয়া<br>\r\nউপজেলা: কেশবপুর<br>\r\nজেলাঃ যশোর <br>\r\n', '', 1, 1, '2016-05-21 00:00:00', 55, '2016-11-28 00:00:00', 4, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
