INSERT INTO `os_content` VALUES(91, 'একাডেমিক ক্যালেন্ডার', 'একাডেমিক-ক্যালেন্ডার', '<p>একাডেমিক ক্যালেন্ডার<span id="pastemarkerend">&nbsp;</span><br>\r\n\r\n</p>\r\n\r\n\r\n<table id="maintable" cellspacing="0" cellpadding="0" border="1" width="960px">\r\n\r\n<tbody>\r\n\r\n	<tr>\r\n\r\n<th style="text-align:center;color: #BF8DFF;padding: 10px;" width="">Sl.no</th>\r\n\r\n\r\n<th style="text-align:center;color: #BF8DFF;padding: 10px;" width="">Day and date</th>\r\n\r\n\r\n<th style="text-align:center;color: #BF8DFF;padding: 10px;" width="">Description</th>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">1</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">১৫ আগস্ট ২০১৭ মঙ্গল বার ০১ দিন।</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">জাতীয় শোক দিবস।</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">2</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">৩০ আগস্ট বুধ বার থেকে ০৯ সেপ্টেম্বর ২০১৭ শনিবার পর্যন্ত ০৯ দিন।</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">পবিত্র ঈদ-উল-আযহা</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">3</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">২২ সেপ্টেম্বের ২০১৭ শুক্রবার</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">হিজরী নববর্ষ</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">4</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">২৭শে সেপ্টেম্বর/১৭ বুধ বার থেকে ০৫ই অক্টোবর/১৭ বৃহস্পতি বার পর্যন্ত</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">দূর্গাপূজা, পবিত্র আশুরা,প্রবারণা পূর্ণীমা ও শ্রী শ্রী লক্ষী পূজা </td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">5</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">১৯শে অক্টোবর/২০১৭ বৃহস্পতি বার</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">শ্রী শ্রী শ্যামা পূজা</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">6</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">১৫ই নভেম্বর/২০১৭ বুধ বার</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">আখেরী চাহার সোম্বা</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">7</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">১লা ডিসেম্বর/২০১৭ শুক্রবার</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">পবিত্র ঈ-ই-মিলাদউন্নব্বী (সাঃ)</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">8</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">১৬ই ডিসেম্বর/২০১৭ শনিবার</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">বিজয় দিবস</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">9</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">১৭ই ডিসেম্বর/২০১৭ রবিবার থেকে ৩০শে ডিসেম্বর/২০১৭ শনিবার</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">শীতকালীন অবকাশ, যিশুখ্রিস্টের জন্মদিন ও ফাতেয়া ই-ইয়াজ দাহম</td>\r\n\r\n	</tr>\r\n\r\n\r\n	<tr>\r\n\r\n		<td style="text-align:center;width:100px;padding:5px;">10</td>\r\n\r\n\r\n		<td style="text-align:center;width:200px;padding:5px;">০৩ ( তিন ) দিন।</td>\r\n\r\n\r\n		<td style="text-align:center;width:600px;padding:5px;">প্রধান শিক্ষকের সংরক্ষিত ছুটি</td>\r\n\r\n	</tr>\r\n\r\n</tbody>\r\n\r\n</table>\r\n\r\n<p align="center">\r\n</p>\r\n\r\n<table style="background:#999;margin-top: 20px;margin-bottom: 20px;" cellspacing="0" cellpadding="0" border="0" width="970">\r\n\r\n<tbody>\r\n\r\n	<tr> \r\n\r\n		<td height="64"><br>\r\n</td>\r\n	</tr>\r\n\r\