INSERT INTO `os_content` VALUES(102, 'খেলাধুলা', 'খেলাধুলা', '<p>খেলাধুলা<span id="pastemarkerend">&nbsp;</span><br>\r\n\r\n</p>\r\n\r\n<p style="text-align: justify;">শরীরচর্চা\r\n ও খেলাধুলার প্রতি ছাত্রছাত্রীদের আগ্রহ সৃষ্টির লক্ষ্যে শীতকালে বার্ষিক \r\nক্রীড়া প্রতিযোগিতা ও পুরস্কার বিতরণ অনুষ্ঠানের আয়োজন করা হয়। এর ফলে \r\nছাত্রছাত্রীদের মধ্যে উদ্দীপনা, পারস্পরিক সৌহার্দ্য ও শৃঙ্খলাবোধ জাগ্রত \r\nহয়।</p>\r\n\r\n<p style="text-align: justify;">&nbsp;<span id="pastemarkerend">&nbsp;</span></p>\r\n', '', 1, 14, '2016-05-21 00:00:00', 55, '2017-08-27 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
INSERT INTO `os_content` VALUES(103, 'সাংস্কৃতিক কর্মকান্ড', 'সাংস্কৃতিক-কর্মকান্ড', '<p>প্রতি বছর বিশেষ বিশেষ দিনগুলোতে বিদ্যালয়ের শিক্ষার্থী এবং&nbsp; স্থানীয় শিল্পীদের নিয়ে মনোজ্ঞ সাংস্কৃতিক অনুষ্ঠানের আয়োজন করা হয়।&nbsp;\r\n</p>\r\n<br>\r\n', '', 1, 13, '2016-05-21 00:00:00', 55, '2017-08-27 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
INSERT INTO `os_content` VALUES(104, 'শিক্ষা ভ্রমন', 'শিক্ষা-ভ্রমন', '<p>শিক্ষা ভ্রমন<span id="pastemarkerend">&nbsp;</span><br>\r\n\r\n</p>\r\n\r\nপ্রতিবছরের শুরুতে সকল শিক্ষার্থীদের \r\nনিয়ে শিক্ষাসফরের আয়োজন করা হয়ে থাকে। উক্ত সফরে আনন্দ-বিনোদনমূলক \r\nঅনুষ্ঠানের আয়োজন করে পুরস্কৃত করা হয়ে থাকে, যা শিক্ষক ও শিক্ষার্থীদের \r\nকাছে খুবই উপভোগ্য হয়ে উঠে।<span id="pastemarkerend">&nbsp;</span>', '', 1, 12, '2016-05-21 00:00:00', 55, '2017-08-27 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
