INSERT INTO `os_content` VALUES(115, 'টেন্ডার নোটিশ', 'টেন্ডার-নোটিশ', '<p>টেন্ডার&nbsp;<span id="pastemarkerend"> নোটিশ</span></p>\r\n<p><span id="pastemarkerend">কিছু পুরাতন/বিনষ্ট আসবাব পত্র টেণ্ডারের জন্য দরপত্র আহ্বান করা হল।<br>\r\n</span></p>\r\n', '', 1, 1, '2016-05-21 00:00:00', 55, '2017-08-05 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
INSERT INTO `os_content` VALUES(118, 'প্রধান শিক্ষক', 'প্রধান-শিক্ষক', '<p align="justify">Education is the backbone of a nation . No nation can prosper without \r\neducation.এই বাণী চেতনায় ধারণ করে শিক্ষার আলো ঘরে ঘরে পৌঁছে দেয়ার ব্রতে, নীলফামারী জেলার ডোমার উপজেলাধীন পল্লীর এক অবহেলিত \r\nগ্রাম জোড়াবাড়ী, ১৯৯৩ খ্রিস্টাব্দে স্থাপিত হয় "জোড়াবাড়ী বালীকা নিম্ন মাধ্যমিক বিদ্যালয়"।পরবর্তীতে ২০০২  খ্রিস্টাব্দে প্রতিষ্ঠনটিকে উচ্চ বিদ্যালয়ে উন্নিত করা হয়। অজ্ঞতার অন্ধকার দূর করে শিক্ষার আলো ঘরে ঘরে পৌঁছে \r\nদেয়ার ক্ষেত্রে আজও এর কোনো ক্লান্তি নেই- নেই কোনো শ্রান্তি। বর্তমান \r\nতথ্য-প্রযুক্তি নির্ভরতার যুগ সন্ধিক্ষণের সাথে সমানতালে তাল মিলিয়ে এগিয়ে \r\nচলেছে বিদ্যালয়টি। বিদ্যালয়টির সুযোগ্য শিক্ষকমন্ডলী, কর্মচারীবৃন্দ ও \r\nএলাকার জনসাধারণের সার্বিক সহযোগীতা নিয়ে অত্র প্রতিষ্ঠানকে মানসম্মত ও \r\nআধুনিক শিক্ষা প্রতিষ্ঠান হিসেবে গড়ে তুলবো ,এই প্রত্যায় করি।<span id="pastemarkerend">&nbsp;</span></p>\r\n', '', 1, 1, '2016-10-21 00:00:00', 4, '2017-08-27 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, '1501551561_55884.jpg');
INSERT INTO `os_content` VALUES(129, 'A+ এর তথ্য', 'a+-এর-তথ্য', '<p>২০১৬ সালের জে এস সি পরীক্ষায়০৬ জন A+</p>\r\n\r\n<p>নাম: ১। মোছাঃ পারুল আকতার</p>\r\n<p>&nbsp; &nbsp; &nbsp; ২।&nbsp; মোছাঃ যারিন তাছনিম</p>\r\n<p>&nbsp; &nbsp; &nbsp; ৩।&nbsp; মোছাঃ উম্মে হানি মিতু</p>\r\n<p> &nbsp; &nbsp; &nbsp; ৪। &nbsp; মোছাঃ তাছিন জান্নাত</p>\r\n<p> &nbsp; &nbsp; &nbsp; ৫। &nbsp; মোছাঃ সুইটি আকতার</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ৬।&nbsp; মোছাঃ আরফানা আকতার<br>\r\n\r\n</p>\r\n', '', 1, 3, '2016-11-28 00:00:00', 4, '2017-08-20 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 1, NULL);
