INSERT INTO `os_content` VALUES(160, 'ছাত্রিদের ড্রস ', 'ছাত্রিদের-ড্রস-', '<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>বালিকা (৬ ষ্ট&nbsp;শ্রেণী-১০ম শ্রেণী)</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>কামিজ খয়েরি রঙের কামিজ (হাটুর চার থেকে আট ইঞ্চি নিচ পর্যন্ত)</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>বেল্ট ও ক্রস ওড়না ১.৫ ইঞ্চি চওড়া সাদা রঙেরকাপড়ের বেল্ট ও ৫ ইঞ্চি চওড়া ক্রস ওড়না।</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>&nbsp;সাদা রঙের সালোয়ার।</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>ওড়না ৭ ফুট X ৩ ফুট মাপের সাদা ওড়না।</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>জুতা সাদা রঙয়ের কাপড়ের হার্ডসোল জুতা।</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"><b>মোজা পাতলা সাদা মোজা।</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><br>\r\n</p>\r\n<p style="text-align: justify; color: green;">&nbsp;<span style="color: #008000;"><b>শীতকালীন পোশাক</b></span></p>\r\n\r\n<p style="text-align: justify; color: green;"><span style="color: #008000;"></span><span style="color: #008000;"><b>নেভী ব্লু রঙের ফুল হাতাসুয়েটার (কার্ডিগান)।</b></span>\r\n</p>\r\n<p>\r\n                                                </p>\r\n\r\n<p>\r\n</p>\r\n\r\n<p>\r\n</p>\r\n<div>\r\n<div align="center"><b><a href="http://dakshinckjs.edu.bd/2015-05-04-17-40-08/uniform?id=17"><span size="4em"></span></a></b><span size="3em"></span>\r\n</div>\r\n\r\n</div>\r\n\r\n<br>\r\n\r\n<p>\r\n</p>\r\n', '', 1, 19, '2017-08-06 00:00:00', 55, '2017-08-27 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
