INSERT INTO `os_content` VALUES(174, '2017 সালের নবম শ্রেণীর নিবন্ধন নোটিশ ', '2017-সালের-নবম-শ্রেণীর-নিবন্ধন-নোটিশ-সকল-', '<p align="justify">এত দ্বারা অত্র বিদ্যালয়ের নবম শ্রেণীর ছাত্রীদের \r\nঅবগতির জন্য জানানো যাইতেছে যে , ২০১৭-২০১৮ শিক্ষাবর্ষের নিবন্ধনের জন্য \r\nনিবন্ধন ফি বাবদ ৩০০/- (তিন শত) টাকা আগামী ০৩/০৮/২০১৭ইং তারিখ হইতে \r\n১৫/০৭/২০১৭ইং তারিখের মধ্যে অফিস চলাকালীন সময়ে অফিস কক্ষে জমা দেয়ার জন্য \r\nবিশেষ ভাবে বলা হইল। কোন শিক্ষর্থী নির্দিষ্ট সময়ের মধ্যে নির্ধারিত ফি জমা\r\n দিতে ব্যর্থ হইলে এবং ইহার কারণে নিবন্ধন করা না গেলে বিদ্যালয় কর্তৃপক্ষ \r\nদায়ী থাবিবে না।</p>\r\n\r\n<p align="justify">  আদেশক্রমে<br>\r\n\r\n</p>\r\n\r\n<p align="justify">( মোঃ মমিনুর রহমান )<br>\r\n\r\n</p>\r\n\r\n<p align="justify">  প্রধান শিক্ষক<span id="pastemarkerend">&nbsp;</span></p>\r\n', '', 1, 7, '2017-08-13 00:00:00', 55, '2017-08-13 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, '1502620919_photo0556.jpg');
INSERT INTO `os_content` VALUES(175, 'শিক্ষক শিক্ষাথী সংক্রন্ত তথ্য', 'শিক্ষক-শিক্ষাথী-সংক্রন্ত-তথ্য', '<p>অত্র বিদ্যালয়ে এগারো জন শিক্ষক শিক্ষিকা ও পাঁচ জন কর্মচারী কর্মরত আছে।</p>\r\n<p>শ্রেণী শিক্ষার্থী সংখ্যা নিম্ন রূপ:</p>\r\n\r\n<table id="table80302">\r\n<tbody></tbody>\r\n</table>\r\n<p>ষষ্ঠ শ্রেণী- ৩৩ জন</p>\r\n<p>সপ্তম শ্রেণী- ৩০ জন</p>\r\n<p>অষ্টম শ্রেণী- ৬০ জন</p>\r\n<p>নবম শ্রেণী- ২২ জন</p>\r\n<p>দশম শ্রেণী- ১০ জন<br>\r\n</p>\r\n\r\n<table id="table13367">\r\n<tbody></tbody>\r\n</table>\r\n', '', 1, 20, '2017-08-13 00:00:00', 55, '2017-08-13 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
INSERT INTO `os_content` VALUES(176, 'প্রতিষ্ঠানের ভবন পরিচিতি', 'প্রতিষ্ঠানের-ভবন-পরিচিতি', '<p>ভবনের বর্ণণাঃ-</p>\r\n\r\n<p>প্রতিষ্ঠানটি তার নিজ ভবনে পরিচালিত হয়ে আসছে। ইহাতে ০৯ কক্ষ বিশিষ্ট এল আকারের একটি আধাপাকা ভবন আছে। একটি প্রধান শিক্ষকের কক্ষ, একিটি অফিস কক্ষ, একটি শিক্ষক কমন রুম, একটি মাল্টিমিডিয়া ক্লাশ রুম সহ বাকি কক্ষগুলো শ্রেণী কক্ষ হিসেবে ব্যবহৃত হয়। সব কক্ষই পরিস্কার পরিচ্ছন্ন তাকে। শিক্ষক শিক্ষার্থীদের পৃথক পৃথক টয়লেটের ব্যাবস্থা আছে। বিদ্যালয় সংলগ্ন একটি খেলার মাঠ আছে। মাঠের চার পাশে অনেক বনজ ফলজ গাছ আছে। শিক্ষার্থীরা প্রতিদিন মাঠে খেলাধুলা করে।<br>\r\n</p>\r\n<p><img src="/images/1502643270_20161025_131323.jpg" alt=""></p>\r\n<p>\r\n</p>\r\n', '', 1, 24, '2017-08-13 00:00:00', 55, '2017-08-13 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
