INSERT INTO `os_content` VALUES(178, ' শিক্ষার্থীদের আসন', '-শিক্ষার্থীদের-আসন', '<p>শিক্ষার্থীদের জন্য পর্যাপ্ত আসনের ব্যসস্থা আছে।<br>\r\n</p>\r\n', '', 1, 26, '2017-08-15 00:00:00', 55, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
INSERT INTO `os_content` VALUES(180, 'মাল্টিমিডিয়া ক্লাশরুম ও কম্পিউটার ল্যাব', 'মাল্টিমিডিয়া-ক্লাশরুম-ও-কম্পিউটার-ল্যাব', '<p>বিদ্যালয়ের একটি শ্রেণী কক্ষ মাল্টিমিডিয়া ক্লাশরুম<span id="pastemarkerend"> হিসেবে ব্যবহার করা হয়। সেখানে শিক্ষার্থীদের মাল্টিমিডিয়ার সাহায্যে শিক্ষকদের সহযোগিতায়</span><span id="pastemarkerend"> পর্যায় ক্রমে</span><span id="pastemarkerend"> বিভিন্ন শ্রেণীর&nbsp; ক্লাশ নেয়া হয়। বিদ্যালয়ে কোন কম্পিউটার ল্যাব নেই। তবে বিদ্যালয়ের নিজেস্ব ডেক্সটপ ও ল্যাব টবের সাহায্যে শিক্ষার্থীদের তথ্য ও যোগাযোগ প্রযুক্তি এবং কম্পিউটার বিষয়ে পাঠদান করানো হয়।</span><br>\r\n\r\n</p>\r\n', '', 1, 28, '2017-08-15 00:00:00', 55, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
INSERT INTO `os_content` VALUES(181, 'কক্ষ সংখ্যা ', 'কক্ষ-সংখ্যা-', '<p> বিদ্যালয়টিতে ০৯ কক্ষ বিশিষ্ট এল আকারের একটি আধাপাকা ভবন আছে। একটি প্রধান \r\nশিক্ষকের কক্ষ, একিটি অফিস কক্ষ, একটি শিক্ষক কমন রুম, একটি মাল্টিমিডিয়া \r\nক্লাশ রুম সহ বাকি কক্ষগুলো শ্রেণী কক্ষ হিসেবে ব্যবহৃত হয়। সব কক্ষই \r\nপরিস্কার পরিচ্ছন্ন তাকে। শিক্ষক শিক্ষার্থীদের পৃথক পৃথক টয়লেটের \r\nব্যাবস্থা আছে। বিদ্যালয় সংলগ্ন একটি খেলার মাঠ আছে। মাঠের চার পাশে অনেক \r\nবনজ ফলজ গাছ আছে। শিক্ষার্থীরা প্রতিদিন মাঠে খেলাধুলা করে।<span id="pastemarkerend">&nbsp;</span></p>\r\n', '', 1, 25, '2017-08-15 00:00:00', 55, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
INSERT INTO `os_content` VALUES(183, 'ভৌত সুযোগ-সুবিধা-১ (ক)', 'ভৌত-সুযোগ-সুবিধা-১-(ক)', '<p style="width:810px; height:45px; margin-top:0px; border:1px solid #8CD891;">\r\n </p>\r\n<p style=" float:left;width:810px !important; width:800px;text-align:center;">মাদ্ রাসা সম্পর্কিত তথ্য ছক -\r\n\r\n<input id="year" name="year" value="2014" readonly="true" style="width:45px;border:none; background:none;" type="text">\r\n</p>\r\n\r\n     <p style="float:left;width:810px !important; width:800px;text-align:center;" align="left">খ. ভৌত সুযোগ-সুবিধা </p>\r\n\r\n\r\n<p style="float:left;width:800px;text-align:center; text-align:left;"> \r\n </p>\r\n<p style="float:left;width:250px;height:auto;margin-left:5px; text-align:left;">৬. প্রতিষ্ঠানটির মোট জমির পরিমাণঃ </p>\r\n\r\n   <p style=" float:left; width:250px; height:auto; margin-left:5px; text-align:left;">\r\n\r\n<input name="totalLandS" id="totalLandS" maxlength="10" value="313" style="width:80px;" type="text">&nbsp;শতাংশ</p>\r\n\r\n\r\n<p id="2nd_div" style="float:left;width:810px !important; width:800px; height:auto; background-color:none; margin-top:5px;">\r\n</p>\r\n<p style=" float:left; width:250px; height:auto; margin-left:5px; text-align:left;">\r\n   ক. অখন্ডঃ&nbsp;\r\n\r\n<input name="attachedLandS" id="attachedLandS" maxlength="5" value="252" style="width:80px;" type="text">&nbsp;শতাংশ</p>\r\n\r\n<p style=" float:left; width:250px; height:auto; margin-left:5px; text-align:left;">\r\n   খ. অন্যত্রঃ&nbsp;\r\n\r\n<input name="outsideLandS" id="outsideLandS" maxlength="5" value="61" style="width:80px;" type="text">&nbsp;শতাংশ</p>\r\n\r\n\r\n<p id="2nd_div" style="float:left;width:810px !important; width:800px; height:auto; background-color:none; margin-top:5px;">\r\n   </p>\r\n<p style="float:left;width:700px;height:auto;margin-left:5px; text-align:left;">গ.জমির ব্যবহার ও পরিমাণ (শতাংশে)</p>\r\n\r\n   <p id="table_div" style="float:left;width:810px !important; width:800px; height:auto;  margin-top:5px;">\r\n</p>\r\n