INSERT INTO `os_content` VALUES(186, 'ভৌত সুযোগ-সুবিধা স্কুল ( ১ )', 'ভৌত-সুযোগ-সুবিধা-স্কুল-(-১-)', '<p><a href="http://emis.gov.bd:3030/IMS/Reports/PageRPT_C_Facilities.aspx">ভৌত সুযোগ-সুবিধা স্কুল ( ১ )</a>    </p>\r\n', '', 1, 3, '2017-08-21 00:00:00', 55, '2017-09-08 00:00:00', 55, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
INSERT INTO `os_content` VALUES(187, 'ছাত্রিদের জন্য নিয়ম কানুন', 'ছাত্রিদের-জন্য-নিয়ম-কানুন', '<p style="text-align: justify;">স্কুলের\r\n প্রত্যেক শিক্ষার্থীর ভদ্র, শালীন ও আদর্শ শিক্ষার্থীসুলভ আচরণ বাঞ্ছনীয়। \r\nক্লাসে যথাসময়ে উপস্থিতি, নীরবতা, পরিচ্ছন্নতা ও শৃঙ্খলা একান্তভাবে কাম্য।</p>\r\n\r\n<p style="text-align: justify;">শিক্ষার্থীদের নিম্নোক্ত আচরণবিধি মেনে চলা আবশ্যক:</p>\r\n\r\n<p style="text-align: justify;">০১। প্রতিদিন স্কুল আসা বাধ্যতামূলক।</p>\r\n\r\n<p style="text-align: justify;">০২।\r\n প্রতিষ্ঠানের নির্ধারিত পোশাক ছাড়া স্কুল প্রাঙ্গণে প্রবেশ নিষেধ। এছাড়া \r\nস্কুল ইউনিফর্ম পরে স্কুল বাইরে কোন প্রকার অশোভন কাজ করেছে বলে প্রমাণিত \r\nহলে তার বিরুদ্ধে শাস্তিমূলক ব্যবস্থা নেয়া হবে। প্রয়োজনে T.C দেয়া হবে।</p>\r\n\r\n<p style="text-align: justify;">০৩।\r\n প্রত্যেক শিক্ষার্থীকে সবসময় যথাযথ আন্তরিক হতে হবে ও গ্রহণযোগ্য কাঙ্খিত \r\n(নম্র, ভদ্র, বিনয়, &nbsp;শালীন) আচরণ করতে হবে। যেকোন ধরনের আপত্তিকর আচরণের \r\nজন্য শাস্তিমূলক ব্যবস্থা অনিবার্য।</p>\r\n\r\n<p style="text-align: justify;">০৪।\r\n নিয়মিত ক্লাসে উপস্থিত, পরিষ্কার-পরিচ্ছন্ন পোশাক পরিধান করা এবং কথা ও \r\nকাজে সৌজন্যবোধ থাকা প্রত্যেক শিক্ষার্থীর জন্য অত্যাবশ্যক।</p>\r\n\r\n<p style="text-align: justify;">০৫।\r\n শিক্ষার্থীদের কোন অবহেলা ও বিশৃঙ্খলাজনিত কারণে স্কুলের কোন সম্পদ বা \r\nযন্ত্রাংশের ক্ষতি সাধিত হলে তাদেরকেই &nbsp;ক্ষতিপূরণ দিতে হবে।</p>\r\n\r\n<p style="text-align: justify;">০৬। নির্দিষ্ট কর্তৃপক্ষের অনুমতি ব্যতীত কোন শিক্ষার্থী স্কুল ক্যাম্পাসের বাইরে যেতে পারবে না।</p>\r\n\r\n<p style="text-align: justify;">০৭। স্কুল প্রাঙ্গণে প্রবেশের পর জরুরি অবস্থা, জটিল সমস্যা ও স্বাস্থ্যগত অবনতি ছাড়া ছুটি দেয়া হবে না।</p>\r\n\r\n<p style="text-align: justify;">০৮।\r\n ডায়েরি, পরীক্ষার খাতা, প্রোগ্রেস রিপোর্ট ইত্যাদিতে স্বাক্ষর নকল করা, \r\nকোন লেখা মূছে ফেলা বা ঘষামাজা করা শাস্তিযোগ্য অপরাধ বলে বিবেচিত হবে।</p>\r\n\r\n<p style="text-align: justify;">০৯। শিক্ষার্থীদের অবশ্যই ক্লাস শুরুর ৫-১০ মিনিট পূর্বে শ্রেণিকক্ষে হাজির থাকতে হবে।</p>\r\n\r\n<p style="text-align: justify;">১০। স্কুলের নিয়ম বহির্ভূত কোন আচরণ বা কাজের জন্য তিনবারের অধিক বিশেষ মন্তব্য পাবার পর তাকে ছাড়পত্র দিয়ে বের করে দেয়া হবে।</p>\r\n\r\n<p style="text-align: justify;">১১। শ্রেণিকক্ষে বেঞ্চ, ডেস্ক, চেয়ার, টেবিল, ব্ল্যাকবোর্ড, দেয়াল অথবা টয়লেটে কোনকিছু লেখা শাস্তিযোগ্য অপরাধ।</p>\r\n\r\n<p style="text-align: justify;">১২।\r\n পাঠের অপ্রয়োজনীয় কোন কিছু, যেমন- মোবাইল, সিডি, দামী ঘড়ি, ষ্টীলের স্কেল,\r\n গহনা, ছবি, গল্পের বই, ব্যক্তিগত ডায়েরি, স্টিকার, ভিজিটিং কার্ড, লিফলেট \r\nবা অপ্রাসঙ্গিক দ্রব্যাদি স্কুলে আনা বা সঙ্গে রাখা সম্পূর্ণ নিষেধ।</p>\r\n\r\n<p style="text-align: justify;">১৩।\r\n জুনিয়র শিক্ষার্থীরা সিনিয়র শিক্ষার্থীদের বড় ভাই/বোন বলে মনে করা এবং \r\nতদনুযায়ী আচরণ করা, একইভাবে সিনিয়র শিক্ষার্থীরা জুনিয়র শিক্ষার্থীদেরকে \r\nছোট ভাই/বোন মনে করা এবং তদনুযায়ী আচরণ করা বাঞ্ছনীয়।</p>\r\n\r\n<p style="text-align: justify;">১৪। ধূমপান কিংবা রাজনৈতিক তৎপরতা চালানো সম্পূর্ণ নিষিদ্ধ।</p>\r\n\r\n<p style="text-align: justify;">১৫। ক্লাস চলাকালীন অনুমতি ছাড়া কেউ শিক্ষার্থীর সাথে সাক্ষাৎ করতে পারবে না।</p>\r\n\r\n<p style="text-align: justify;">১৬।\r\n শিক্ষাবর্ষের প্রতি সাময়িকে প্রত্যেক শিক্ষার্থীকে শতভাগ ক্লাসে উপস্থিত \r\nথাকতে হবে। যৌক্তিক কারণ ব্যতীত কর্তৃপক্ষকে অবহিত না করে একটানা ০৭ দিন \r\nক্লাসে অনুপস্থিত থাকলে তার বিরুদ্ধে শাস্তিমূলক ব্যবস্থা গ্রহণ করা হবে। \r\nবিশেষ কারণে কোন শিক্ষার্থীকে অনুপস্থিত থাকতে হলে তার উপস্থিতি মোট \r\nঅনুষ্ঠিত ক্লাসের ৭৫% উপস্থিত থাকতে হবে। এর কম উপস্থিতি থাকলে অভ্যন্তরীণ \r\nঅথবা বোর্ড পরীক্ষায় অংশগ্রহণ করতে দেয়া হবে না।</p>\r\n\r\n<p style="text-align: justify;">১৭। কোন শিক্ষার্থী ক্লাস চলাকালে ক্লাসের বাইরে থাকতে পারবে না।</p>\r\n\r\n<p style="text-align: justify;">১৮।\r\n কোনক্রমেই ছুটির সময় অথবা টিফিনের সময় হৈ চৈ করা যাবে না। শ্রেণীকক্ষের \r\nপাশে বা বারান্দা দিয়ে চলাফেরার সময় কোন রকম গোলমাল করা যাবে না।</p>\r\n\r\n<p style="text-align: justify;">১৯। কারো সাথে মারামরি কিংবা অসৌজন্যমূলক আচরণ সম্পূর্ণ নিষিদ্ধ। ইহা শাস্তিযোগ্য অপরাধ।</p>\r\n\r\n<p style="text-align: justify;">২০। লাইব্রেরির বই হারালে বা ক্ষতি সাধন করলে প্রতিটি বইয়ের জন্য দ্বিগুণ মূল্য প্রদান করতে হবে।</p>\r\n\r\n<p style="text-align: justify;">২১। ছাত্রছাত্রীদেরকে নির্ধারিত আইডি কার্ড, ডায়েরি ও খাতা নির্দিষ্ট মূল্যে প্রতিষ্ঠান থেকে সংগ্রহ করতে হবে।</p>\r\n\r\n<p style="text-align: justify;">২২। সর্বোপরি স্কুলের সুনাম ক্ষুন্ন হওয়ার মত শিক্ষার্থীদের যেকোন অনিয়ম/অশালীনতা শাস্তিযোগ্য অপরাধ বলে গণ্য হবে।</p>\r\n\r\n<p style="text-align: justify;">২৩। কোন শিক্ষার্থী শৃঙ্খলাবিরোধী কাজে লিপ্ত হলে বাধ্যতামূলক টি.সি. দেয়া হবে।<span id="pastemarkerend">&nbsp;</span></p>\r\n', '', 1, 19, '2017-08-27 00:00:00', 55, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, '', '', 0, 0, NULL);
