INSERT INTO `os_content` VALUES(195, 'বিগত তিন বছরের পাবলিক পরীক্ষার ফলাফল :-', 'বিগত-তিন-বছরের-পাবলিক-পরীক্ষার-ফলাফল-:-', '<p>\r\n</p>\r\n\r\n<p style="text-align:center" align="center"><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;\r\ncolor:#2E74B5;">জোড়াবাড়ী বালিকা উচ বিদ্যালয়</span><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;color:#2E74B5;">&nbsp;   <br>\r\n</span></p>\r\n<p style="text-align:center" align="center"><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;color:#2E74B5;"> </span><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;"></span><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;">ডাকঘরঃ মিরজাগঞ্জ, উপজেলাঃ ডোমার, জেলাঃ নীলফামারী।</span><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;color:#2E74B5;"></span></p>\r\n<p style="text-align:center" align="center"><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;       \r\n স্খাপিতঃ ১৯৯৩ইং।&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; EIIN NO : 124854</span></p>\r\n<p style="text-align:center" align="center"><span style="Shonar Bangla&quot;,&quot;sans-serif&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nb